-- 导出  表 zuji_order_2.order_return 结构
CREATE TABLE IF NOT EXISTS `order_return` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `business_key` tinyint(11) unsigned DEFAULT '0' COMMENT '退款业务 退货业务 换货业务',
  `goods_no` varchar(100) DEFAULT '' COMMENT '商品编号',
  `order_no` varchar(100) DEFAULT '' COMMENT '订单编号',
  `user_id` int(11) unsigned DEFAULT '0' COMMENT '用户ID',
  `pay_amount` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '实际支付金额',
  `refund_amount` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '应退 退款金额',
  `auth_unfreeze_amount` decimal(10,2) DEFAULT '0.00' COMMENT '应退押金金额',
  `auth_deduction_amount` decimal(10,2) DEFAULT '0.00' COMMENT '应扣押金金额',
  `loss_type` tinyint(1) unsigned DEFAULT '0' COMMENT '损耗类型 1:全新未拆封,2:已拆封已使用',
  `reason_id` int(11) unsigned DEFAULT '0' COMMENT '申请退换货原因ID',
  `reason_text` varchar(200) DEFAULT '' COMMENT '申请退换货原因',
  `logistics_id` int(3) DEFAULT '0' COMMENT '物流类型',
  `logistics_name` varchar(50) DEFAULT NULL COMMENT '物流名称',
  `logistics_no` varchar(50) DEFAULT '' COMMENT '收货物流编号',
  `status` int(2) unsigned DEFAULT '0' COMMENT '0初始化 1提交申请 2同意 3审核拒绝 4已取消 5已收货 7退货完成 8换货完成 9已退款 10退款中 11换货已发货',
  `reason_key` int(11) DEFAULT NULL COMMENT '审核原因id',
  `evaluation_status` tinyint(1) DEFAULT NULL COMMENT '检测状态',
  `evaluation_remark` varchar(200) DEFAULT NULL COMMENT '检测备注',
  `evaluation_time` int(11) DEFAULT '0' COMMENT '检测时间',
  `evaluation_amount` decimal(10,2) DEFAULT '0.00' COMMENT '检测金额',
  `remark` text COMMENT '审核备注',
  `refuse_refund_remark` text COMMENT '检测不合格拒绝退款备注信息',
  `refund_no` varchar(100) DEFAULT NULL COMMENT '退货单号',
  `old_refund_id` varchar(100) DEFAULT NULL COMMENT '老的退货退款单号',
  `out_refund_no` varchar(100) DEFAULT '' COMMENT '支付系统返回退款流水账号',
  `receive_no` varchar(100) DEFAULT NULL COMMENT '收货单编号',
  `barter_logistics_id` varchar(50) DEFAULT NULL COMMENT '换货物流渠道',
  `barter_logistics_no` varchar(50) DEFAULT NULL COMMENT '换货物流编号',
  `create_time` int(11) unsigned DEFAULT '0' COMMENT '创建时间',
  `check_time` int(11) unsigned DEFAULT '0' COMMENT '审核时间',
  `delivery_time` int(11) DEFAULT '0' COMMENT '换货发货时间',
  `update_time` int(11) unsigned DEFAULT '0' COMMENT '最后更新时间',
  `complete_time` int(11) DEFAULT '0' COMMENT '完成时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `refund_no` (`refund_no`),
  KEY `goods_no` (`goods_no`),
  KEY `order_no` (`order_no`),
  KEY `id` (`id`),
  KEY `old_refund_id` (`old_refund_id`),
  KEY `business_key` (`business_key`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=249 DEFAULT CHARSET=utf8 COMMENT='订单退换货表';

